/** Uses the expect-type package to assert type matching. */
export function assertTypeOf(
/** Run-time value to type check. */
input) {
    // run time implementation for this doesn't matter
    const runTimeProxy = new Proxy({}, {
        get: (target, property) => {
            if (property === 'not') {
                return runTimeProxy;
            }
            return () => true;
        },
    });
    return runTimeProxy;
}
